@testable import NFCPassportReader
import XCTest

final class SODTests: XCTestCase {
    func testVerifyAndReturnSODEncapsulatedDataShouldPassForDocWithHashInSigningAlg() {
        if let sod1 = try? SOD(SODData.sodBG5Data),
           let sod2 = try? SOD(SODData.sodLT5Data),
           let sod3 = try? SOD(SODData.sodSK1Data) {
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod1))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod2))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod3))
        }
    }
    
    func testVerifyAndReturnSODEncapsulatedDataShouldPassForDocWithSigningAlgParams() {
           if let sod1 = try? SOD(SODData.sodNorTurquoiseIDData),
               let sod2 = try? SOD(SODData.sodNorRedIDData),
               let sod3 = try? SOD(SODData.sodNorTurquoisePassportData),
               let sod4 = try? SOD(SODData.sodNorRedPassportData),
               let sod5 = try? SOD(SODData.sodNorSalmonPassportData) {
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod1))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod2))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod3))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod4))
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod5))
        }
    }
    
    func testVerifyAndReturnSODEncapsulatedDataShouldPassForDocUsingDigestHash() {
        if let sod = try? SOD(SODData.sodAU20Data) {
            XCTAssertNoThrow(try OpenSSLUtils.verifyAndReturnSODEncapsulatedData(sod: sod))
        }
    }
}

